import React from "react";
import "./App.css";
import HomePage from "./pages/homepage/homepage";
import { Switch, Route } from "react-router-dom";

const Hats = () => {
  return <div>Hats</div>;
};

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/Hats" component={Hats} />
      </Switch>
    </div>
  );
}

export default App;
